function ExpenseItem(){

    const expenseDate = new Date(2024,7,30);
    const expenseTitle = "Car Insurance";
    const expenseAmount = 1000;


    return (<div>
        <div>{expenseDate.toISOString()}</div>
        <div>
            <h2>{expenseTitle}</h2>
            <div>${expenseAmount}</div>
        </div>


    </div>);
}

export default ExpenseItem;
